    QString fullPath = QString(_serverConfigs["endpointsUpdate"][_serverIndices.value("endpointsUpdate")].URL()+"/subscriptions/{subscriptionId}/resourceGroups/{resourceGroupName}/providers/Microsoft.Network/trafficmanagerprofiles/{profileName}/{endpointType}/{endpointName}");
    
    
